import React, { Component } from 'react';
import './OrderItems.css';

export default class OrderItems extends Component {
  renderList = arr => {
    arr.map(item => {
      <div className="order-item-container">
        <div className="item-card">{item.item}</div>
      </div>;
    });
    return (
      <div class="order-grid">
        <div className="order-item-container">
          <div className="item-card">Beef</div>
        </div>
        <div className="order-item-container">
          <div className="item-card">Duck</div>
        </div>
        <div className="order-item-container">
          <div className="item-card">test</div>
        </div>
      </div>
    );
  };

  render() {
    return <div>{this.renderList(this.props.OrderItems)}</div>;
  }
}
